    "# Big Mart Sales Prediction - Complete ML Pipeline\n",
    "import pandas as pd\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "import seaborn as sns\n",
    "from sklearn.model_selection import train_test_split, cross_val_score, GridSearchCV\n",
    "from sklearn.preprocessing import LabelEncoder, StandardScaler\n",
    "from sklearn.ensemble import RandomForestRegressor, GradientBoostingRegressor\n",
    "from sklearn.linear_model import LinearRegression, Ridge, Lasso\n",
    "from sklearn.tree import DecisionTreeRegressor\n",
    "from sklearn.metrics import mean_squared_error, mean_absolute_error, r2_score\n",
    "import warnings\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "# Set style for plots\n",
    "plt.style.use('seaborn-v0_8')\n",
    "sns.set_palette(\"husl\")\n",
    "\n",
    "class BigMartSalesPredictor:\n",
    "    def __init__(self):\n",
    "        self.label_encoders = {}\n",
    "        self.scaler = StandardScaler()\n",
    "        self.models = {}\n",
    "        self.feature_importance = {}\n",
    "        \n",
    "    def load_data(self, train_path=None, test_path=None):\n",
    "        \"\"\"Load training and test data\"\"\"\n",
    "        if train_path and test_path:\n",
    "            self.train_data = pd.read_csv(train_path)\n",
    "            self.test_data = pd.read_csv(test_path)\n",
    "        else:\n",
    "            # Generate sample data for demonstration\n",
    "            self.generate_sample_data()\n",
    "        \n",
    "        print(f\"Training data shape: {self.train_data.shape}\")\n",
    "        print(f\"Test data shape: {self.test_data.shape}\")\n",
    "        \n",
    "    def generate_sample_data(self):\n",
    "        \"\"\"Generate sample Big Mart data for demonstration\"\"\"\n",
    "        np.random.seed(42)\n",
    "        n_samples = 8523\n",
    "        \n",
    "        # Item identifiers\n",
    "        item_ids = ['FD' + str(i).zfill(4) for i in range(1, 1560)] + \\\n",
    "                  ['DR' + str(i).zfill(4) for i in range(1, 93)] + \\\n",
    "                  ['NC' + str(i).zfill(4) for i in range(1, 9)]\n",
    "        \n",
    "        # Outlet identifiers\n",
    "        outlet_ids = ['OUT010', 'OUT013', 'OUT017', 'OUT018', 'OUT019', \n",
    "                     'OUT027', 'OUT035', 'OUT045', 'OUT046', 'OUT049']\n",
    "        \n",
    "        # Generate training data\n",
    "        train_data = {\n",
    "            'Item_Identifier': np.random.choice(item_ids, n_samples),\n",
    "            'Item_Weight': np.random.normal(12.86, 4.64, n_samples),\n",
    "            'Item_Fat_Content': np.random.choice(['Low Fat', 'Regular', 'low fat', 'LF', 'reg'], n_samples),\n",
    "            'Item_Visibility': np.random.exponential(0.066, n_samples),\n",
    "            'Item_Type': np.random.choice([\n",
    "                'Dairy', 'Soft Drinks', 'Meat', 'Fruits and Vegetables', 'Household',\n",
    "                'Baking Goods', 'Snack Foods', 'Frozen Foods', 'Breakfast',\n",
    "                'Health and Hygiene', 'Hard Drinks', 'Canned', 'Breads',\n",
    "                'Starchy Foods', 'Others', 'Seafood'\n",
    "            ], n_samples),\n",
    "            'Item_MRP': np.random.uniform(31.29, 266.89, n_samples),\n",
    "            'Outlet_Identifier': np.random.choice(outlet_ids, n_samples),\n",
    "            'Outlet_Establishment_Year': np.random.choice([1985, 1987, 1997, 1998, 1999, 2002, 2004, 2007, 2009], n_samples),\n",
    "            'Outlet_Size': np.random.choice(['Small', 'Medium', 'High', np.nan], n_samples, p=[0.3, 0.4, 0.2, 0.1]),\n",
    "            'Outlet_Location_Type': np.random.choice(['Tier 1', 'Tier 2', 'Tier 3'], n_samples),\n",
    "            'Outlet_Type': np.random.choice(['Grocery Store', 'Supermarket Type1', 'Supermarket Type2', 'Supermarket Type3'], n_samples)\n",
    "        }\n",
    "        \n",
    "        # Generate sales based on realistic relationships\n",
    "        sales_base = (train_data['Item_MRP'] * np.random.uniform(8, 25, n_samples) + \n",
    "                     np.random.normal(0, 500, n_samples))\n",
    "        sales_base = np.clip(sales_base, 33.29, 13086.96)\n",
    "        train_data['Item_Outlet_Sales'] = sales_base\n",
    "        \n",
    "        self.train_data = pd.DataFrame(train_data)\n",
    "        \n",
    "        # Generate test data (without sales)\n",
    "        n_test = 5681\n",
    "        test_data = {\n",
    "            'Item_Identifier': np.random.choice(item_ids, n_test),\n",
    "            'Item_Weight': np.random.normal(12.86, 4.64, n_test),\n",
    "            'Item_Fat_Content': np.random.choice(['Low Fat', 'Regular', 'low fat', 'LF', 'reg'], n_test),\n",
    "            'Item_Visibility': np.random.exponential(0.066, n_test),\n",
    "            'Item_Type': np.random.choice([\n",
    "                'Dairy', 'Soft Drinks', 'Meat', 'Fruits and Vegetables', 'Household',\n",
    "                'Baking Goods', 'Snack Foods', 'Frozen Foods', 'Breakfast',\n",
    "                'Health and Hygiene', 'Hard Drinks', 'Canned', 'Breads',\n",
    "                'Starchy Foods', 'Others', 'Seafood'\n",
    "            ], n_test),\n",
    "            'Item_MRP': np.random.uniform(31.29, 266.89, n_test),\n",
    "            'Outlet_Identifier': np.random.choice(outlet_ids, n_test),\n",
    "            'Outlet_Establishment_Year': np.random.choice([1985, 1987, 1997, 1998, 1999, 2002, 2004, 2007, 2009], n_test),\n",
    "            'Outlet_Size': np.random.choice(['Small', 'Medium', 'High', np.nan], n_test, p=[0.3, 0.4, 0.2, 0.1]),\n",
    "            'Outlet_Location_Type': np.random.choice(['Tier 1', 'Tier 2', 'Tier 3'], n_test),\n",
    "            'Outlet_Type': np.random.choice(['Grocery Store', 'Supermarket Type1', 'Supermarket Type2', 'Supermarket Type3'], n_test)\n",
    "        }\n",
    "        \n",
    "        self.test_data = pd.DataFrame(test_data)\n",
    "        \n",
    "        # Add missing values to simulate real data\n",
    "        missing_indices = np.random.choice(self.train_data.index, size=int(0.17 * len(self.train_data)), replace=False)\n",
    "        self.train_data.loc[missing_indices, 'Item_Weight'] = np.nan\n",
    "        \n",
    "        missing_indices_test = np.random.choice(self.test_data.index, size=int(0.17 * len(self.test_data)), replace=False)\n",
    "        self.test_data.loc[missing_indices_test, 'Item_Weight'] = np.nan\n",
    "    \n",
    "    def explore_data(self):\n",
    "        \"\"\"Exploratory Data Analysis\"\"\"\n",
    "        print(\"=\" * 50)\n",
    "        print(\"EXPLORATORY DATA ANALYSIS\")\n",
    "        print(\"=\" * 50)\n",
    "        \n",
    "        # Basic info\n",
    "        print(\"\\nTraining Data Info:\")\n",
    "        print(self.train_data.info())\n",
    "        \n",
    "        print(\"\\nTraining Data Description:\")\n",
    "        print(self.train_data.describe())\n",
    "        \n",
    "        print(\"\\nMissing Values:\")\n",
    "        print(self.train_data.isnull().sum())\n",
    "        \n",
    "        # Visualizations\n",
    "        fig, axes = plt.subplots(2, 3, figsize=(18, 12))\n",
    "        \n",
    "        # Sales distribution\n",
    "        axes[0, 0].hist(self.train_data['Item_Outlet_Sales'], bins=50, alpha=0.7)\n",
    "        axes[0, 0].set_title('Sales Distribution')\n",
    "        axes[0, 0].set_xlabel('Item Outlet Sales')\n",
    "        axes[0, 0].set_ylabel('Frequency')\n",
    "        \n",
    "        # MRP vs Sales\n",
    "        axes[0, 1].scatter(self.train_data['Item_MRP'], self.train_data['Item_Outlet_Sales'], alpha=0.5)\n",
    "        axes[0, 1].set_title('MRP vs Sales')\n",
    "        axes[0, 1].set_xlabel('Item MRP')\n",
    "        axes[0, 1].set_ylabel('Item Outlet Sales')\n",
    "        \n",
    "        # Sales by Outlet Type\n",
    "        self.train_data.groupby('Outlet_Type')['Item_Outlet_Sales'].mean().plot(kind='bar', ax=axes[0, 2])\n",
    "        axes[0, 2].set_title('Average Sales by Outlet Type')\n",
    "        axes[0, 2].tick_params(axis='x', rotation=45)\n",
    "        \n",
    "        # Item Visibility distribution\n",
    "        axes[1, 0].hist(self.train_data['Item_Visibility'], bins=50, alpha=0.7)\n",
    "        axes[1, 0].set_title('Item Visibility Distribution')\n",
    "        axes[1, 0].set_xlabel('Item Visibility')\n",
    "        axes[1, 0].set_ylabel('Frequency')\n",
    "        \n",
    "        # Sales by Fat Content\n",
    "        self.train_data.groupby('Item_Fat_Content')['Item_Outlet_Sales'].mean().plot(kind='bar', ax=axes[1, 1])\n",
    "        axes[1, 1].set_title('Average Sales by Fat Content')\n",
    "        axes[1, 1].tick_params(axis='x', rotation=45)\n",
    "        \n",
    "        # Correlation heatmap\n",
    "        numeric_cols = self.train_data.select_dtypes(include=[np.number]).columns\n",
    "        corr_matrix = self.train_data[numeric_cols].corr()\n",
    "        sns.heatmap(corr_matrix, annot=True, cmap='coolwarm', center=0, ax=axes[1, 2])\n",
    "        axes[1, 2].set_title('Correlation Matrix')\n",
    "        \n",
    "        plt.tight_layout()\n",
    "        plt.show()\n",
    "    \n",
    "    def preprocess_data(self):\n",
    "        \"\"\"Data preprocessing and feature engineering\"\"\"\n",
    "        print(\"\\n\" + \"=\" * 50)\n",
    "        print(\"DATA PREPROCESSING\")\n",
    "        print(\"=\" * 50)\n",
    "        \n",
    "        # Combine train and test for consistent preprocessing\n",
    "        self.train_data['source'] = 'train'\n",
    "        self.test_data['source'] = 'test'\n",
    "        \n",
    "        # Store target variable\n",
    "        target = self.train_data['Item_Outlet_Sales'].copy()\n",
    "        \n",
    "        # Combine datasets\n",
    "        combined_data = pd.concat([self.train_data.drop('Item_Outlet_Sales', axis=1), self.test_data], \n",
    "                                ignore_index=True)\n",
    "        \n",
    "        print(f\"Combined data shape: {combined_data.shape}\")\n",
    "        \n",
    "        # Handle missing values\n",
    "        print(\"\\nHandling missing values...\")\n",
    "        \n",
    "        # Fill missing Item_Weight with mean by Item_Identifier\n",
    "        item_weight_mean = combined_data.groupby('Item_Identifier')['Item_Weight'].transform('mean')\n",
    "        combined_data['Item_Weight'].fillna(item_weight_mean, inplace=True)\n",
    "        \n",
    "        # Fill remaining missing weights with overall mean\n",
    "        combined_data['Item_Weight'].fillna(combined_data['Item_Weight'].mean(), inplace=True)\n",
    "        \n",
    "        # Fill missing Outlet_Size based on Outlet_Type mode\n",
    "        outlet_size_mode = combined_data.groupby('Outlet_Type')['Outlet_Size'].apply(\n",
    "            lambda x: x.mode()[0] if not x.mode().empty else 'Medium'\n",
    "        )\n",
    "        combined_data['Outlet_Size'] = combined_data.apply(\n",
    "            lambda x: outlet_size_mode[x['Outlet_Type']] if pd.isna(x['Outlet_Size']) else x['Outlet_Size'], \n",
    "            axis=1\n",
    "        )\n",
    "        \n",
    "        # Feature Engineering\n",
    "        print(\"Engineering features...\")\n",
    "        \n",
    "        # Standardize Item_Fat_Content\n",
    "        fat_content_mapping = {\n",
    "            'low fat': 'Low Fat', 'LF': 'Low Fat', 'reg': 'Regular'\n",
    "        }\n",
    "        combined_data['Item_Fat_Content'] = combined_data['Item_Fat_Content'].replace(fat_content_mapping)\n",
    "        \n",
    "        # Create new features\n",
    "        combined_data['Outlet_Age'] = 2013 - combined_data['Outlet_Establishment_Year']\n",
    "        \n",
    "        # Item category from Item_Identifier\n",
    "        combined_data['Item_Category'] = combined_data['Item_Identifier'].str[:2]\n",
    "        \n",
    "        # MRP categories\n",
    "        combined_data['Item_MRP_Category'] = pd.cut(combined_data['Item_MRP'], \n",
    "                                                  bins=[0, 69, 136, 203, 270], \n",
    "                                                  labels=['Low', 'Medium', 'High', 'Very High'])\n",
    "        \n",
    "        # Visibility mean by item type\n",
    "        item_visibility_mean = combined_data.groupby('Item_Type')['Item_Visibility'].transform('mean')\n",
    "        combined_data['Item_Visibility_Mean_Ratio'] = combined_data['Item_Visibility'] / item_visibility_mean\n",
    "        \n",
    "        # Binary features\n",
    "        combined_data['Item_Fat_Content_Binary'] = combined_data['Item_Fat_Content'].map({'Low Fat': 0, 'Regular': 1})\n",
    "        \n",
    "        # Encode categorical variables\n",
    "        categorical_cols = ['Item_Fat_Content', 'Item_Type', 'Outlet_Size', \n",
    "                          'Outlet_Location_Type', 'Outlet_Type', 'Item_Category', 'Item_MRP_Category']\n",
    "        \n",
    "        for col in categorical_cols:\n",
    "            if col not in self.label_encoders:\n",
    "                self.label_encoders[col] = LabelEncoder()\n",
    "                combined_data[col + '_Encoded'] = self.label_encoders[col].fit_transform(combined_data[col].astype(str))\n",
    "            else:\n",
    "                combined_data[col + '_Encoded'] = self.label_encoders[col].transform(combined_data[col].astype(str))\n",
    "        \n",
    "        # Select features for modeling\n",
    "        feature_cols = [\n",
    "            'Item_Weight', 'Item_Visibility', 'Item_MRP', 'Outlet_Establishment_Year',\n",
    "            'Outlet_Age', 'Item_Visibility_Mean_Ratio', 'Item_Fat_Content_Binary'\n",
    "        ] + [col + '_Encoded' for col in categorical_cols]\n",
    "        \n",
    "        # Split back to train and test\n",
    "        train_mask = combined_data['source'] == 'train'\n",
    "        \n",
    "        self.X_processed = combined_data[train_mask][feature_cols].copy()\n",
    "        self.y_processed = target.copy()\n",
    "        self.X_test_processed = combined_data[~train_mask][feature_cols].copy()\n",
    "        \n",
    "        print(f\"Processed training features shape: {self.X_processed.shape}\")\n",
    "        print(f\"Processed test features shape: {self.X_test_processed.shape}\")\n",
    "        \n",
    "        # Scale features\n",
    "        self.X_processed_scaled = self.scaler.fit_transform(self.X_processed)\n",
    "        self.X_test_processed_scaled = self.scaler.transform(self.X_test_processed)\n",
    "        \n",
    "        print(\"Preprocessing completed!\")\n",
    "    \n",
    "    def train_models(self):\n",
    "        \"\"\"Train multiple models and compare performance\"\"\"\n",
    "        print(\"\\n\" + \"=\" * 50)\n",
    "        print(\"MODEL TRAINING\")\n",
    "        print(\"=\" * 50)\n",
    "        \n",
    "        # Split data\n",
    "        X_train, X_val, y_train, y_val = train_test_split(\n",
    "            self.X_processed, self.y_processed, test_size=0.2, random_state=42\n",
    "        )\n",
    "        \n",
    "        # Define models\n",
    "        models_config = {\n",
    "            'Linear Regression': LinearRegression(),\n",
    "            'Ridge Regression': Ridge(alpha=1.0),\n",
    "            'Lasso Regression': Lasso(alpha=1.0),\n",
    "            'Decision Tree': DecisionTreeRegressor(random_state=42),\n",
    "            'Random Forest': RandomForestRegressor(n_estimators=100, random_state=42),\n",
    "            'Gradient Boosting': GradientBoostingRegressor(random_state=42)\n",
    "        }\n",
    "        \n",
    "        results = {}\n",
    "        \n",
    "        for name, model in models_config.items():\n",
    "            print(f\"\\nTraining {name}...\")\n",
    "            \n",
    "            # Train model\n",
    "            model.fit(X_train, y_train)\n",
    "            \n",
    "            # Predictions\n",
    "            y_pred_train = model.predict(X_train)\n",
    "            y_pred_val = model.predict(X_val)\n",
    "            \n",
    "            # Calculate metrics\n",
    "            train_rmse = np.sqrt(mean_squared_error(y_train, y_pred_train))\n",
    "            val_rmse = np.sqrt(mean_squared_error(y_val, y_pred_val))\n",
    "            train_r2 = r2_score(y_train, y_pred_train)\n",
    "            val_r2 = r2_score(y_val, y_pred_val)\n",
    "            \n",
    "            results[name] = {\n",
    "                'model': model,\n",
    "                'train_rmse': train_rmse,\n",
    "                'val_rmse': val_rmse,\n",
    "                'train_r2': train_r2,\n",
    "                'val_r2': val_r2\n",
    "            }\n",
    "            \n",
    "            print(f\"Train RMSE: {train_rmse:.2f}, Val RMSE: {val_rmse:.2f}\")\n",
    "            print(f\"Train RÂ²: {train_r2:.4f}, Val RÂ²: {val_r2:.4f}\")\n",
    "            \n",
    "            # Store feature importance for tree-based models\n",
    "            if hasattr(model, 'feature_importances_'):\n",
    "                self.feature_importance[name] = model.feature_importances_\n",
    "        \n",
    "        self.models = {name: result['model'] for name, result in results.items()}\n",
    "        self.model_results = results\n",
    "        \n",
    "        # Find best model\n",
    "        best_model_name = min(results.keys(), key=lambda x: results[x]['val_rmse'])\n",
    "        self.best_model_name = best_model_name\n",
    "        self.best_model = results[best_model_name]['model']\n",
    "        \n",
    "        print(f\"\\nBest Model: {best_model_name}\")\n",
    "        print(f\"Best Validation RMSE: {results[best_model_name]['val_rmse']:.2f}\")\n",
    "        \n",
    "        # Model comparison visualization\n",
    "        self.plot_model_comparison()\n",
    "    \n",
    "    def plot_model_comparison(self):\n",
    "        \"\"\"Plot model performance comparison\"\"\"\n",
    "        model_names = list(self.model_results.keys())\n",
    "        train_rmse = [self.model_results[name]['train_rmse'] for name in model_names]\n",
    "        val_rmse = [self.model_results[name]['val_rmse'] for name in model_names]\n",
    "        \n",
    "        fig, (ax1, ax2) = plt.subplots(1, 2, figsize=(15, 6))\n",
    "        \n",
    "        # RMSE comparison\n",
    "        x = np.arange(len(model_names))\n",
    "        width = 0.35\n",
    "        \n",
    "        ax1.bar(x - width/2, train_rmse, width, label='Train RMSE', alpha=0.8)\n",
    "        ax1.bar(x + width/2, val_rmse, width, label='Validation RMSE', alpha=0.8)\n",
    "        ax1.set_xlabel('Models')\n",
    "        ax1.set_ylabel('RMSE')\n",
    "        ax1.set_title('Model Performance Comparison (RMSE)')\n",
    "        ax1.set_xticks(x)\n",
    "        ax1.set_xticklabels(model_names, rotation=45, ha='right')\n",
    "        ax1.legend()\n",
    "        ax1.grid(True, alpha=0.3)\n",
    "        \n",
    "        # RÂ² comparison\n",
    "        train_r2 = [self.model_results[name]['train_r2'] for name in model_names]\n",
    "        val_r2 = [self.model_results[name]['val_r2'] for name in model_names]\n",
    "        \n",
    "        ax2.bar(x - width/2, train_r2, width, label='Train RÂ²', alpha=0.8)\n",
    "        ax2.bar(x + width/2, val_r2, width, label='Validation RÂ²', alpha=0.8)\n",
    "        ax2.set_xlabel('Models')\n",
    "        ax2.set_ylabel('RÂ² Score')\n",
    "        ax2.set_title('Model Performance Comparison (RÂ²)')\n",
    "        ax2.set_xticks(x)\n",
    "        ax2.set_xticklabels(model_names, rotation=45, ha='right')\n",
    "        ax2.legend()\n",
    "        ax2.grid(True, alpha=0.3)\n",
    "        \n",
    "        plt.tight_layout()\n",
    "        plt.show()\n",
    "    \n",
    "    def hyperparameter_tuning(self):\n",
    "        \"\"\"Perform hyperparameter tuning for the best models\"\"\"\n",
    "        print(\"\\n\" + \"=\" * 50)\n",
    "        print(\"HYPERPARAMETER TUNING\")\n",
    "        print(\"=\" * 50)\n",
    "        \n",
    "        # Random Forest tuning\n",
    "        rf_params = {\n",
    "            'n_estimators': [50, 100, 200],\n",
    "            'max_depth': [10, 20, None],\n",
    "            'min_samples_split': [2, 5],\n",
    "            'min_samples_leaf': [1, 2]\n",
    "        }\n",
    "        \n",
    "        print(\"Tuning Random Forest...\")\n",
    "        rf_grid = GridSearchCV(\n",
    "            RandomForestRegressor(random_state=42),\n",
    "            rf_params,\n",
    "            cv=3,\n",
    "            scoring='neg_mean_squared_error',\n",
    "            n_jobs=-1\n",
    "        )\n",
    "        rf_grid.fit(self.X_processed, self.y_processed)\n",
    "        \n",
    "        # Gradient Boosting tuning\n",
    "        gb_params = {\n",
    "            'n_estimators': [50, 100, 200],\n",
    "            'learning_rate': [0.05, 0.1, 0.2],\n",
    "            'max_depth': [3, 5, 7]\n",
    "        }\n",
    "        \n",
    "        print(\"Tuning Gradient Boosting...\")\n",
    "        gb_grid = GridSearchCV(\n",
    "            GradientBoostingRegressor(random_state=42),\n",
    "            gb_params,\n",
    "            cv=3,\n",
    "            scoring='neg_mean_squared_error',\n",
    "            n_jobs=-1\n",
    "        )\n",
    "        gb_grid.fit(self.X_processed, self.y_processed)\n",
    "        \n",
    "        self.tuned_models = {\n",
    "            'Random Forest (Tuned)': rf_grid.best_estimator_,\n",
    "            'Gradient Boosting (Tuned)': gb_grid.best_estimator_\n",
    "        }\n",
    "        \n",
    "        print(f\"Best Random Forest params: {rf_grid.best_params_}\")\n",
    "        print(f\"Best Gradient Boosting params: {gb_grid.best_params_}\")\n",
    "        \n",
    "        # Update best model if tuned version is better\n",
    "        rf_score = -rf_grid.best_score_\n",
    "        gb_score = -gb_grid.best_score_\n",
    "        \n",
    "        if rf_score < gb_score:\n",
    "            self.best_model = rf_grid.best_estimator_\n",
    "            self.best_model_name = 'Random Forest (Tuned)'\n",
    "        else:\n",
    "            self.best_model = gb_grid.best_estimator_\n",
    "            self.best_model_name = 'Gradient Boosting (Tuned)'\n",
    "        \n",
    "        print(f\"Updated best model: {self.best_model_name}\")\n",
